import React, { useState, useEffect } from 'react';
import { Container } from 'react-bootstrap';
import GUIIcons from '../../general/GUIIcons';
import Offcanvas from 'react-bootstrap/Offcanvas';
import { capitalizeFirstLetter } from '../../../functions/capitalizeFirstLetter';


function StickyDetails() {
  const [topValue, setTopValue] = useState(0);

  const handleScroll = () => {
    // Mettre à jour topValue en fonction de la position de défilement
    // Par exemple, vous pouvez simplement utiliser window.scrollY ou une formule personnalisée
    setTopValue(window.scrollY);
  };

  useEffect(() => {
    window.addEventListener('scroll', handleScroll);

    return () => {
      window.removeEventListener('scroll', handleScroll);
    };
  }, []);

  //OffCanvas
  const [show, setShow] = useState(false);

  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);



  const [vehicleConditions, setVehicleConditions] = useState([]);
  useEffect(() => {
    const fetchVehicleConditions = async () => {
      try {
        const response = await fetch("http://localhost:5001/api/vehicleConditions");
        const data = await response.json();
        setVehicleConditions(data);
      } catch (error) {
        console.error("Error fetching vehicle conditions:", error);
      }
    };
    fetchVehicleConditions();
  }, []);

  return (
    <>
    <div style={{
        position: 'absolute',
        top: `${topValue}px`,
        left: '1000px',
        width: '500px',
        height: 'auto',
        transition: 'all 0.5s ease'
      }}
        className='stick-info-wrapper'>
        <Container className='mt-2 mb-3'>
        <h3 className="stick-info-title">Marque + Models </h3>
        <p className='stick-infos'> 2014 - 354 541 km </p>
        <p className='stick-infos'> diesel - automatique </p>
        <p className='stick-infos align-items-top' onClick={handleShow}> Bon <GUIIcons.Info className='info-icon'/></p>

        </Container>
        <Container className='mt-2 mb-3 stick-description-wrapper py-3'>
            <h4 className="stick-info-title text-dark">Description de l'expert</h4>
            <p className='stick-infos text-dark'>Waouw ce véhicule est en parfait état ça alors et il fait vroumvroum</p>
        </Container>
          <div className="d-flex flex-column justify-content-center align-items-center">

          <h4 className='stick-info-garantie'>Garantie 12 mois</h4>
          <h3 className="stick-info-price">1 520 €</h3>
          <h4 className='stick-info-garantie mt-4'>Une question ? Un rendez-vous ?</h4>
          <button className="btn btn-primary mb-3">Nous contacter</button>
          </div>
    </div>


    <Offcanvas show={show} onHide={handleClose} backdrop="static">
        <Offcanvas.Header closeButton>
          <Offcanvas.Title>États des véhicules</Offcanvas.Title>
        </Offcanvas.Header>
        <Offcanvas.Body>
        <ul className="px-3">
          {vehicleConditions.map((condition, index) => (
            <li key={index} className="text-light">
             <span className='offcanvas-condition-name'>  {capitalizeFirstLetter(condition.name) + " : " } </span> <br/>
              <span className='offcanvas-condition-description'>{condition.description}</span>
            </li>
          ))}
</ul>

        </Offcanvas.Body>
      </Offcanvas>

    </>
  );
}

export default StickyDetails;
